import BookingForm from "./BookingForm";
import React, { Component } from 'react';

class Drone extends Component {
  render() {
    return (
    <div className="box-wrap">
      <div className="slide2">
        <div className="slide2content"> 
        <img style={{ width: "450px", height: "350px", objectFit: "cover" }} src={this.props.drone.image} />
        <h3> {this.props.drone.name} </h3>
        <h2>Rent Price: ${this.props.drone.rentprice} </h2>
        <p> {this.props.drone.description} </p>
        <BookingForm/>
        </div>
      </div>
    </div>
    );
  }

}

export default Drone;
